import React, { Component } from 'react';
import { NavLink, withRouter } from 'react-router-dom';

import IntlMessages from '../../util/IntlMessages';


class Menu extends Component {

  componentDidMount() {
    const { history } = this.props;

    const pathname = `#${history.location.pathname}`;// get current path
    const mainMenu = document.getElementsByClassName('nav-item');
    for (let i = 0; i < mainMenu.length; i++) {
      mainMenu[i].onclick = function () {
        for (let j = 0; j < mainMenu.length; j++) {
          if (mainMenu[j].classList.contains('active')) {
            mainMenu[j].classList.remove('active')
          }
        }
        this.classList.toggle('active');
      }
    }
    const subMenuLi = document.getElementsByClassName('nav-arrow');
    for (let i = 0; i < subMenuLi.length; i++) {
      subMenuLi[i].onclick = function () {
        for (let j = 0; j < subMenuLi.length; j++) {
          if (subMenuLi[j].classList.contains('active')) {
            subMenuLi[j].classList.remove('active')
          }
        }
        this.classList.toggle('active');
      }
    }
    const activeLi = document.querySelector('a[href="' + pathname + '"]');// select current a element
    try {
      const activeNav = this.closest(activeLi, 'ul'); // select closest ul
      if (activeNav.classList.contains('sub-menu')) {
        this.closest(activeNav, 'li').classList.add('active');
      } else {
        this.closest(activeLi, 'li').classList.add('active');
      }
      const parentNav = this.closest(activeNav, '.nav-item');
      if (parentNav) {
        parentNav.classList.add('active');
      }

    } catch (e) {

    }

  }

  closest(el, selector) {
    try {
      let matchesFn;
      // find vendor prefix
      ['matches', 'webkitMatchesSelector', 'mozMatchesSelector', 'msMatchesSelector', 'oMatchesSelector'].some(function (fn) {
        if (typeof document.body[fn] === 'function') {
          matchesFn = fn;
          return true;
        }
        return false;
      });

      let parent;

      // traverse parents
      while (el) {
        parent = el.parentElement;
        if (parent && parent[matchesFn](selector)) {
          return parent;
        }
        el = parent;
      }
    } catch (e) {

    }

    return null;
  }


  render() {
    return (
      <div className="app-main-menu d-none d-md-block">
        <ul className="navbar-nav navbar-nav-mega">
          <li className="no-arrow">
            <span className="nav-link">
              <i className="zmdi zmdi-widgets zmdi-hc-fw" />
              <span className="nav-text">
                <IntlMessages id="sidebar.administration" />
              </span>
            </span>
            <ul className="menu">
              <li>
                <NavLink className="prepend-icon" to="/app/administration/professeur">
                  <span className="nav-text"><IntlMessages id="sidebar.professor" /></span>
                </NavLink>
              </li>
              <li className="nav-item">
                <NavLink to="/app/billetPass">
                  <span className="nav-text"><IntlMessages id="pages.sideNav.component.billetPass" /> </span>
                </NavLink>
              </li>

              <li>
                <NavLink className="prepend-icon" to="/app/administration/eleve">
                  <span className="nav-text"><IntlMessages id="sidebar.eleve" /></span>
                </NavLink>
              </li>
            </ul>
          </li>

          <li className="nav-item">
            <NavLink to="/app/call_register">
              <span className="nav-text"><IntlMessages id="pages.registreAppel" /> </span>
            </NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="prepend-icon" to="/app/notes">
              <span className="nav-text"><IntlMessages id="sidebar.notes" /> </span>
            </NavLink>
          </li>



        </ul>
      </div>
    );
  }
}

export default withRouter(Menu);
